import styled from 'styled-components';

export const StyledBody = styled.div`
    margin-top: 8vh;
    display: flex;
    padding: 5rem 0; 
    justify-content: center;

    @media (max-width: 768px) {
        padding: 0; 
        margin-top: 5vh;
    } 
`;
